import React from "react";
import wordle from "./wordle.png";
import './Welcome.css';

function Welcome(props){
    const navigate = useNavigate();

    return(
        <div className="layout">
            <div className="top_bar">
                <div className="mode_title">Hard mode:</div>
                <label className="switch">
                    <input type="checkbox"></input>
                    <span className="slider round"></span>
                </label>
            </div>
            <div className="title">Wordle Game</div>
            <img src={wordle} alt="Logo" className="logo" />
            <div className="subtitle">Get 6 chances to guess a 6-letter word.</div>
            <button className="button_welcome">
                Play
            </button>
            <button className="button_welcome">
                Rule
            </button>
        </div>
    )

    function onClick_rule(){
            navigate('/rules')
    }
}

export default Welcome;
